script: |
  super -f text -I q11026.spq | sort > q11026.out

inputs:
  - name: q11026.spq
    data: |
      SELECT col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT NULL BETWEEN col2 * col2 - - + col0 * - col0 * + 58 + - 15 AND 67 * col0 * - col0 * col2;
  - name: tab0

outputs:
  - name: q11026.out
    data: |
